@justadownloader - Något är det helt klart som går fel för dig, det svåra är bara att veta vad. När uppladdningen fungerat som den skall, så kommer du automatiskt att länkas till den torrent du precis lagt upp.

Har du provat att använda t.ex. Google chrome istället? Med lite tur så kanske det räcker med att du byter browser för att det skall fungera. 

Lycka till nu! :)
